  [],\n\t\"num_tags\": 0,\n\t\"name\": \"intertidal-organism-and-other-data-from-the-montague-in-the-gulf-of-alaska-as-part-of-outer-con\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"Intertidal organism and other data were
  collected in the Gulf of Alaska from the MONTAGUE as part of the Outer Continental
  Shelf Environmental Assessment Program (OCSEAP). Data were collected by the National
  Marine Fisheries Service (NMFS) from 12 September 1974 to 15 October 1974. Data
  were processed by NODC to the NODC standard F30 Inter-tidal Organisms and Habitats
  format. Full format description is available from NODC at www.nodc.noaa.gov/General/NODC-Archive/f030.html.
  An analog file for this accession is available from NODC user services.nnThe F30
  format is used for data from field sampling of marine organisms in intertidal or
  subtidal habitats. The data are collected to provide information about species abundance
  and distribution. Data from each observation may include: cruise and station information
  such as vessel name, senior scientist, position, date, and time; environmental conditions
  such as surface temperature and salinity, wind speed and direction, and sea state;
  sediment and habitat descriptors; and species identification and organism counts
  and measurements. Data may be reported for either individual or composite samples.
  A text record is available for reporting comments.\",\n\t\"owner_org\": \"e811f0b4-451f-4896-9e8f-fc6802837819\",\n\t\"extras\":
